window.bookSummaryJSON = "<p>Damien’s new streaming career is in tatters. </p> <p>With his play style now known to all and Aetherius’ older brother, Magnitude, gaining a stranglehold on high-level content, Damien struggles to maintain his relevance in the ever-changing world of Saga Online.</p> <p>In order to regain his notoriety and fight back against Magnitude’s growing power, Damien must undertake a quest that is far beyond his level. If he succeeds, his occultist character will be changed forever.</p> <p>Meanwhile Lillian has a mission of her own: to find a legendary sword that has the potential to finally bring Magnitude down.</p> <p>One thing’s for sure, it’s gonna be hell.</p>"; 
